void Interface::Menu::Initialize()
{
    ImGuiIO& io = ImGui::GetIO();
    ImGuiStyle& styles = ImGui::GetStyle();

    // Main
    styles.ScrollbarSize = 12.f;

    // Borders
    styles.WindowBorderSize = 0.f;
    styles.ChildBorderSize = 0.f;
    styles.PopupBorderSize = 0.f;
    styles.FrameBorderSize = 0.f;
    styles.TabBarBorderSize = 0.f;
    styles.TabBarBorderSize = 0.f;
    styles.TabBarOverlineSize = 0.f;

    // Roundings
    styles.WindowRounding = 0.f;
    styles.ChildRounding = 0.f;
    styles.FrameRounding = 0.f;
    styles.PopupRounding = 0.f;
    styles.ScrollbarRounding = 0.f;
    styles.GrabRounding = 0.f;
    styles.TabRounding = 0.f;

    // Widgets
    styles.WindowMenuButtonPosition = ImGuiDir_Right;

    ImFontConfig imFontConfig15;
    ImFontConfig imFontConfig12;
    ImFontConfig imFontConfig10;
    ImFontConfig imFontConfigIcon;

    imFontConfig15.SizePixels = 15;
    imFontConfig15.OversampleH = 3;
    imFontConfig15.OversampleV = 3;
    imFontConfig12.SizePixels = 12;
    imFontConfig12.OversampleH = 3;
    imFontConfig12.OversampleV = 3;
    imFontConfig10.SizePixels = 10;
    imFontConfig10.OversampleH = 3;
    imFontConfig10.OversampleV = 3;
    imFontConfigIcon.SizePixels = 23;
    imFontConfigIcon.OversampleH = 3;
    imFontConfigIcon.OversampleV = 3;

    io.Fonts->AddFontFromMemoryCompressedTTF(ProtoMonoRegular_compressed_data, ProtoMonoRegular_compressed_size, 13);
    SUBSTANCE::pFont15 = io.Fonts->AddFontDefault(&imFontConfig15);
    SUBSTANCE::pFont12Light = io.Fonts->AddFontFromMemoryCompressedTTF(ProtoMonoLight_compressed_data, ProtoMonoLight_compressed_size, 12, &imFontConfig12);
    SUBSTANCE::pFont10Light = io.Fonts->AddFontFromMemoryCompressedTTF(ProtoMonoLight_compressed_data, ProtoMonoLight_compressed_size, 10, &imFontConfig10);

    SUBSTANCE::pIconFont = io.Fonts->AddFontFromMemoryCompressedTTF(KGB92_compressed_data, KGB92_compressed_size, 23, &imFontConfigIcon);
}

